import "./Legal.css";
import TitleSection from "../../component/TitleSection/TitleSection.jsx";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLocationDot,faMobileScreen,faEnvelope,faGlobe } from '@fortawesome/free-solid-svg-icons';
import DocumentMeta from 'react-document-meta';
import { useEffect } from "react";

export default function Legal() {
    const meta = {
        meta: {
            name: "robots",
            content: "noindex"
        },
        meta: {
            name: "googlebot",
            content: "noindex"
        }
    }

    useEffect(() => {
        let main = document.querySelector(".legal-main");
        let buttons = main.querySelectorAll("button");
        buttons.forEach(button =>{
            button.addEventListener("click", () => {
                buttons.forEach(button => {
                    button.style.color = "black";
                })
                button.style.color = "blue";
            })
        })
    },[])

    return(
        <main className="legal-main">
            <TitleSection title="MENTIONS LEGALES"/>
            <section className="container">
                <div className="row">
                    <div className="accordion" id="accordionExample">
                        <div className="accordion-item editor">
                            <h2 className="accordion-header" id="headingOne">
                            <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne" aria-expanded="true" aria-controls="collapseOne">
                                ÉDITEUR
                            </button>
                            </h2>
                            <div id="collapseOne" className="accordion-collapse collapse show" aria-labelledby="headingOne" data-bs-parent="#accordionExample">
                            <div className="accordion-body">
                                <h2>John Doe</h2>
                                <address className="editor-address">
                                    <p> <FontAwesomeIcon icon={faLocationDot}/> 2 Rue du Grenache <br/> 11000 Carcassonne, France</p>
                                    <FontAwesomeIcon icon={faMobileScreen}/> <a href="tel:0606060606" className="editor-address__phone">06 06 06 06 06</a><br/>
                                    <FontAwesomeIcon icon={faEnvelope}/> <a href="mailto:john.doe@gmail.com" className="editor-address__mail">john.doe@gmail.com</a>
                                </address>
                            </div>
                            </div>
                        </div>
                        <div className="accordion-item host">
                            <h2 className="accordion-header" id="headingTwo">
                            <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseTwo" aria-expanded="false" aria-controls="collapseTwo">
                                HÉBERGEUR
                            </button>
                            </h2>
                            <div id="collapseTwo" className="accordion-collapse collapse" aria-labelledby="headingTwo" data-bs-parent="#accordionExample">
                            <div className="accordion-body">
                                <h2>Always Data</h2>
                                <address className="host-address">
                                    <p> <FontAwesomeIcon icon={faLocationDot}/> 91 rue du Faubourg Saint Honoré <br/> 75008 Paris</p>
                                    <FontAwesomeIcon icon={faMobileScreen}/> <a href="tel:0184162340" className="editor-address__phone">01 84 16 23 40</a><br/>
                                    <FontAwesomeIcon icon={faGlobe}/> <a href="www.alwaysdata.com" className="host-address__website">www.alwaysdata.com</a>
                                </address>
                            </div>
                            </div>
                        </div>
                        <div className="accordion-item credits">
                            <h2 className="accordion-header" id="headingThree">
                            <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseThree" aria-expanded="false" aria-controls="collapseThree">
                                CRÉDITS
                            </button>
                            </h2>
                            <div id="collapseThree" className="accordion-collapse collapse" aria-labelledby="headingThree" data-bs-parent="#accordionExample">
                            <div className="accordion-body">
                                <h2>Crédits</h2>
                                <p className="text-one">Site développé par John Doe, étudiant au C.E.F.</p>
                                <br/>
                                <p>Les images libres de droits utilisées sont issues du site <FontAwesomeIcon icon={faGlobe}/> <a href="https://pixabay.com/">Pixabay.</a></p>
                            </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
            <DocumentMeta {...meta}/>
        </main>
    )
}
